using AutoMapper;
using log4net;
using Microsoft.AspNetCore.Http;
using Microsoft.Extensions.Configuration;
using Microsoft.VisualStudio.TestTools.UnitTesting;
using NSubstitute;
using Renting.MasterServices.Core.Dtos;
using Renting.MasterServices.Core.Dtos.Provider;
using Renting.MasterServices.Core.Interfaces;
using Renting.MasterServices.Core.Interfaces.Provider;
using Renting.MasterServices.Core.Services;
using Renting.MasterServices.Core.Services.Provider;
using Renting.MasterServices.Domain;
using Renting.MasterServices.Domain.Entities.Provider;
using Renting.MasterServices.Domain.IRepository.Provider;
using Renting.MasterServices.Infraestructure.CustomExceptions;
using System;
using System.IO;
using System.Threading.Tasks;

namespace Renting.MasterServices.Core.Test
{
    [TestClass]
    public class FileProcesingServiceTest
    {
        private IConfigProvider config;
        private IFileProcesingService fileProcesingService;
        private IFormFile file;
        private string extensions;
        private string fileSize;

        [TestInitialize]
        public void Init()
        {
            config = Substitute.For<IConfigProvider>();
            fileProcesingService = new FileProcesingService(config);
            file = Substitute.For<IFormFile>();

            var content = "";
            var fileName = "test.png";
            var memoryStreamFile = new MemoryStream();
            var writer = new StreamWriter(memoryStreamFile);
            writer.Write(content);
            writer.Flush();

            file.OpenReadStream().Returns(memoryStreamFile);
            file.FileName.Returns(fileName);

            extensions = ".png|.jpg|.jpeg";
            fileSize = "500";

        }

        [TestMethod]
        public void ValidateFileExtension_GivenFileWithAllowedExtension()
        {
            //Arrange
            config.GetVal(Arg.Any<string>()).Returns(extensions);

            //Act
            bool result = fileProcesingService.ValidateFileExtension(file);

            //Assert
            Assert.IsTrue(result);
        }

        [TestMethod]
        public void ValidateFileExtension_GivenFileWithNotAllowedExtension()
        {
            //Arrange
            string fileName = "test.gif";
            file.FileName.Returns(fileName);

            config.GetVal(Arg.Any<string>()).Returns(extensions);

            //Act
            bool result = fileProcesingService.ValidateFileExtension(file);

            //Assert
            Assert.IsFalse(result);
        }

        [TestMethod]
        public void ValidateFileSize_GivenFileSizeAllowed()
        {
            //Arrange
            long length = 300;
            file.Length.Returns(length);
            config.GetVal(Arg.Any<string>()).Returns(fileSize);

            //Act
            bool actualValue = fileProcesingService.ValidateFileSize(file);

            //Assert
            Assert.IsTrue(actualValue);
        }

        [TestMethod]
        public void ValidateFileSize_GivenFileSizeNotAllowed()
        {
            //Arrange
            long length = 700;
            file.Length.Returns(length);
            config.GetVal(Arg.Any<string>()).Returns(fileSize);

            //Act
            bool actualValue = fileProcesingService.ValidateFileSize(file);

            //Assert
            Assert.IsFalse(actualValue);
        }


        [TestMethod]
        public void GetFileName_GivenFileWithName()
        {
            //Arrange
            string fileName = "test.png";
            file.Name.Returns(fileName);

            //Act
            string actualValue = fileProcesingService.GetFileName(file);

            //Assert
            Assert.IsNotNull(actualValue);
        }
    }
}
